import React, { Component } from 'react'
import Tab from "../Tab/Tab";
import Header from "../Header/Header";
export default class My extends Component {
    constructor(){
        super();
        this.state={
            title:'我的'
        }
    }
    render() {
        return (
            <div className="my-box">
              <div className="main"></div>
                <Tab></Tab>
            </div>
        )
    }
}
